import React from 'react'
import {useParams} from 'react-router-dom'

function ItemListAside() {
    let {section} = useParams()
    return (
        <div className="col-4 item-list-aside-column">
            <h2>`Estas en ${section}`</h2>
        </div>
    )
}

export default ItemListAside;
